function alignBenefits(benefit){
  var descText = benefit.children;
  for(var i=0; i<descText.length; i++){
      descText[i].classList.add('align');
  }   
}

function appendIcons(benefit,icon){
  var cc_icon_holder = document.createElement('span');
  cc_icon_holder.classList.add("benefit_icons");
  cc_icon_holder.innerHTML = icon;
  benefit.prepend(cc_icon_holder); 
}

document.querySelector(".margin-top-30.ng-star-inserted").classList.add('hide');

